%ExecutingThisMacro%

This example is basically the same as the previous one, except instead of using the jsonStatusLineTemplate option, it uses the sspStatusLineFunction option to supply a JavaScript function that gets called for an item, allowing you to return the the Status Line string.

Here's the function, but make sure you see "IMPORTANT!" below.

function(fieldValues) {
    if (!fieldValues)
        return "";

    var result = "Location: " + fieldValues.city;
    if (fieldValues.state) {
        result = result + ", " + fieldValues.state;
    }
    return result;
}

The function is anonymous, meaning it does't have a name.

The function is passed one parameter, which is an object with the values of the fields specified in jsonStatusLineFields.

If the passed parameter is null, then nothing is selected, so generally you return an empty string.

You access the field values using "dot" notation, as in fieldValues.city.

In this example, a few of the first items in the list don't have a "state", so the result is formatted to take that into account.

IMPORTANT!

When you set the "sspStatusLineFunction" option, the function must all be on one line. So use the following code, which is in the example, to convert the function to be on one line:

￼
￼

jsonStatusLineFunction: %%Variable%%sspStatusLineFunction%%

This replaces new-line characters and tabs with a space. You don't technically need to replace the tabs, but the result looks funny if you don't.
